import axios from 'axios';
import { urlStr } from '../common/constants';

const helloworldService = {
	get: async () => {
		console.log('aaa');
		const res = await axios.get(`${urlStr}/helloworlds`);
		console.log('res1', res.data);
		return res.data;
	},
};

export default helloworldService;
